export const homeView=()=>'\n    <section class="hero-section fade-in" style="background-image: url(\'assets/images/EYR01028.JPG\');">\n        <div class="hero-content">\n            <h1>Haeyeon Lee</h1>\n            <p class="subtitle">SOPRANO</p>\n        </div>\n    </section>\n';export const aboutView=()=>'\n    <section class="content-section fade-in">\n        <h2>About</h2>\n        <div class="split-layout">\n            <div class="text-column">\n                <p>Haeyeon Lee is a distinguished Soprano known for her emotive interpretations and versatile vocal range. [Biography Placeholder]</p>\n            </div>\n            <div class="image-column">\n                <img src="assets/images/EYR00610.JPG" alt="Haeyeon Lee Portrait" class="about-image">\n            </div>\n        </div>\n    </section>\n';export const mediaView=()=>'\n    <section class="content-section fade-in">\n        <h2>Media</h2>\n        <div class="media-tabs">\n            <button class="tab-btn active" data-tab="photos">Photos</button>\n            <button class="tab-btn" data-tab="video">Video</button>\n        </div>\n        <div class="media-content">\n            <div id="photos" class="tab-pane active">\n                <div class="media-grid">\n                    <img src="assets/images/EYR00658.JPG" alt="Performance Photo 1" loading="lazy">\n                    <img src="assets/images/EYR00821.JPG" alt="Performance Photo 2" loading="lazy">\n                    <img src="assets/images/EYR00610.JPG" alt="Portrait" loading="lazy">\n                    <img src="assets/images/EYR01028.JPG" alt="Portrait" loading="lazy">\n                </div>\n            </div>\n            <div id="video" class="tab-pane" style="display:none;">\n                <div class="video-container" style="text-align:center;">\n                    <p>Video Content Placeholder (YouTube Embeds)</p>\n                    <div style="background:#000; color:#fff; height:300px; display:flex; justify-content:center; align-items:center; margin-top:1rem;">\n                        [Video Player]\n                    </div>\n                </div>\n            </div>\n        </div>\n    </section>\n';export const scheduleView=()=>'\n    <section class="content-section fade-in">\n        <h2>Schedule</h2>\n        <ul class="schedule-list">\n            <li class="schedule-item">\n                <span class="date">OCT 2026</span>\n                <span class="event">Recital at Arts Center</span>\n                <span class="location">Seoul, Korea</span>\n            </li>\n        </ul>\n    </section>\n';export const contactView=()=>'\n    <section class="content-section fade-in">\n        <h2>Contact</h2>\n        <div class="contact-info">\n            <p>Email: <a href="mailto:info@haeyeonlee.com">info@haeyeonlee.com</a></p>\n        </div>\n    </section>\n';